import React, { Component } from 'react'

class SignIn extends Component {
    render() {
        const {
            logged_in,
            sign_in_route,
            sign_out_route
          } = this.props

        return (
            <div>
                {logged_in &&
            <div>
                <a href={sign_out_route}>Sign Out</a>
            </div>
            }
             {!logged_in &&
            <div>
                <a href={sign_in_route}>Sign In</a>
            </div>
            }
            </div>
        )
    }
}

export default SignIn
